import React from "react";
import './doneTask.scss';

export const DoneTask = ({task,done,setDone,inputId,setInputId}) => {
    console.log(task.id,inputId, 'DONETASK')
    return(
        <div className= {done && inputId === task.id ? `task-item_text text` : `task-item_text` }
             onClick={ () => {
                 setInputId(task.id)
                 setDone(!done)
             }}
        >
            {task.task}
        </div>
    )
}
